import React from "react";
import './NavBar.css';


const NavBar = () => {
  return (
    <nav>
        <div className="container">
            <a className="brand-logo">Game Swap</a>
            <ul>
                <a href="/sign-up">Sign Up</a>
                <a href="/login">Login</a>
            </ul> 
        </div>    
    </nav>
  );
};

export default NavBar;
